import React from "react";

function Table(props){

    return (
        <tr id={props.ID} className="border-bottom ">
            <td className="{{props.ID}}" >1</td> {/*id = {props.index} */}
            <td><img src="/imag/{props.thumbnail}" alt=""/></td>
            <td className="FirstName" ondblclick="update(this, 'FirstName', '{props.ID}', '{props.FirstName}')">{props.FirstName }</td>
            <td className="LastName" ondblclick="update(this, 'LastName', '{props.ID}', '{props.LastName}')">{props.LastName }</td>
            <td className="height" ondblclick="update(this, 'height', '{props.ID}', '{props.height}')">{props.height}</td>

            <td>
                <button className="btn btn-outline-danger" onClick="props.deleteMe('{props.ID}')" ><i className="fa-sharp fa-solid fa-trash"></i></button>
            </td>
        </tr>
    )
}

export default Table;
